  input = [
    "[{\"id\":\"rec0DFGX4S5qt3uAw\",\"created_at\":\"2021-07-29T04:12:59.000Z\",\"updated_keys\":[],\"fields\":{\"Question\":\"I know this is Welcome to Nowhere but where the hell is it?\",\"Answer\":\"Welcome to Nowhere is held on an isolated piece of regenerating bush on a farm half way between Whanganui and Hunterville. We can’t tell you exactly where the location is yet but we can tell you that there is a swimming hole, natural amphitheatre and miles of sprawling native bush! Destination details and directions will be released to ticket holders.\",\"Order\":\"1\"}},{\"id\":\"rec1RW5JrZGGPXqzO\",\"created_at\":\"2021-07-29T04:22:19.000Z\",\"updated_keys\":[],\"fields\":{\"Question\":\"Is there clean water for drinking and showers?\",\"Answer\":\"We have fresh water tanks on site that are suitable for drinking and dishes. There are no showering facilities.\",\"Order\":\"9\"}},{\"id\":\"rec5rvzWlVKK4RiR5\",\"created_at\":\"2021-07-29T04:29:59.000Z\",\"updated_keys\":[],\"fields\":{\"Question\":\"Is there a payment plan for purchasing tickets?\",\"Answer\":\"Please send an email to \\u003ca href=\\\"mailto:eyegum.music@gmail.com\\\"\\u003eeyegum.music@gmail.com\\u003c/a\\u003e if you would like to set up a payment plan to pay for your ticket.\",\"Order\":\"15\"}},{\"id\":\"rec7DZcp2Zxd0SCH7\",\"created_at\":\"2021-07-29T04:24:44.000Z\",\"updated_keys\":[],\"fields\":{\"Question\":\"How do I apply to play at the festival?\",\"Answer\":\"We aren’t taking artist applications and have already booked our line up for Welcome to Nowhere 2022. Keep an eye out for artist applications next year or \\u003ca href=\\\"https://airtable.com/shrrtHtc9IA0MbXcK\\\"\\u003eapply to play an Eyegum Wednesday\\u003c/a\\u003e\",\"Order\":\"11\"}},{\"id\":\"rec9L4LMrUAyMne2E\",\"created_at\":\"2021-07-29T04:21:07.000Z\",\"updated_keys\":[],\"fields\":{\"Question\":\"Can I sleep in my car?\",\"Answer\":\"There is plenty of space for tents/camping and campervan/caravans/vans. You can sleep in your campervan/van* in the designated areas. You can’t drive into the camping area and aren't permitted to sleep in your car.\\n\\n*A campervan/van is defined as a large vehicle that is clearly designed or retrofitted for sleeping and camping. This does not include a small vehicle (e.g. station wagon) that someone wishes to sleep in. If you hold a campervan/van pass but your vehicle does not meet this definition (as determined by our gate staff on arrival), you will be required to pay for a parking pass.\",\"Order\":\"8\"}},{\"id\":\"recEpGWdwzslxgPwD\",\"created_at\":\"2021-09-17T04:51:29.000Z\",\"updated_keys\":[],\"fields\":{\"Question\":\"What happens if I'm sick and can't make it to the festival?\",\"Answer\":\"Please don't attend the festival if you are feeling unwell or display any COVID-19 symptoms. Send an email to \\u003ca href=\\\"mailto:eyegum.music@gmail.com\\\"\\u003eeyegum.music@gmail.com\\u003c/a\\u003e and we will get back to you about refunding your ticket. Please note that we may not get back to you until the festival is over and we have access to the internet.\",\"Order\":\"19\"}},{\"id\":\"recGxts4twaw7G72h\",\"created_at\":\"2021-09-27T03:29:53.000Z\",\"updated_keys\":[],\"fields\":{\"Question\":\"Will I need to present a COVID-19 vaccine pass?\",\"Answer\":\"Under the COVID-19 Protection Framework, all attendees will need to show a valid My Vaccine Pass (and photo ID if requested) upon entry to the festival. If someone is unable to show a valid vaccine pass they will not be able to attend the festival and will be denied entry. We strongly recommend that all ticket holders get fully vaccinated as soon as possible to ensure they are able to attend the festival. See below for information on how to refund your ticket if you aren't planning on getting vaccinated before the festival. See the government COVID-19 website for more information on the protection framework and vaccine passes for events: https://covid19.govt.nz/.\",\"Order\":\"17\"}},{\"id\":\"recHB28GyHFi9nrs6\",\"created_at\":\"2021-07-29T04:22:28.000Z\",\"updated_keys\":[],\"fields\":{\"Question\":\"Can I busk or set up my own \\\"renegade stage\\\"?\",\"Answer\":\"No thanks. Our amazing team have spent the whole year programming an awesome line up for you all and unprogrammed music/busking is annoying and undermines the effort of the organisers \\u003c3\",\"Order\":\"10\"}},{\"id\":\"recIVjkYRTD2XRVGI\",\"created_at\":\"2021-07-29T04:28:26.000Z\",\"updated_keys\":[],\"fields\":{\"Question\":\"What should I bring with me?\",\"Answer\":\"Welcome to Nowhere is a camping festival. Make sure you are well prepared with a tent (or caravan), sleeping bag, and plenty of warm clothes. The days are hot and the nights are cold so we recommend coming well prepared with lots of warm clothing and bedding.\",\"Order\":\"3\"}},{\"id\":\"recKpadgzwAzI2mG5\",\"created_at\":\"2021-07-29T04:29:41.000Z\",\"updated_keys\":[],\"fields\":{\"Question\":\"What if I need to buy supplies? Are there any towns nearby?\",\"Answer\":\"The nearest town is Whanganui, about 30 minutes drive away. Not only is it a great place to stock up, but it is also a beautiful city with lots to see and do. Why not check it out while you’re in the area, or even stay a night. To find out more visit \\u003ca href=\\\"https://discoverwhanganui.nz/visit/\\\"\\u003eDiscover Whanganui\\u003c/a\\u003e\",\"Order\":\"14\"}},{\"id\":\"recSRHOMfhs4tGbho\",\"created_at\":\"2021-07-29T04:12:59.000Z\",\"updated_keys\":[],\"fields\":{\"Question\":\"What can I expect at Welcome to Nowhere?\",\"Answer\":\"2.5 jam packed summer days/nights of camping, music, poetry, theatre and art in a remote and idyllic setting! We have curated three officials stages which will showcase some of Aotearoa's finest independent music acts and up-and-coming poets and artists. We are a small collective run festival, so you can expect a close knit community event where everybody looks out for one another. \",\"Order\":\"2\"}},{\"id\":\"recVasIxAvsWLAzik\",\"created_at\":\"2021-07-29T04:22:04.000Z\",\"updated_keys\":[],\"fields\":{\"Question\":\"What if the festival is cancelled due to COVID-19?\",\"Answer\":\"In the event that the festival is cancelled due to COVID-19 restrictions, natural disaster, fire, flood or other similar major event beyond the event organisers control, we will be offering an undetermined partial refund to ticket holders after event costs have been covered. \",\"Order\":\"16\"}},{\"id\":\"recaqjv9l8yk2dkY3\",\"created_at\":\"2021-07-29T04:12:59.000Z\",\"updated_keys\":[],\"fields\":{\"Question\":\"Who’s performing?\",\"Answer\":\"We’ve put together what we reckon is a pretty exciting and eclectic lineup. We’ll be announcing the first round of artists in early October and second lineup thereafter. All artists will be displayed on our website as they're announced.\",\"Order\":\"4\"}},{\"id\":\"recciX4tGKmWhFZiL\",\"created_at\":\"2021-07-29T04:27:41.000Z\",\"updated_keys\":[],\"fields\":{\"Question\":\"What is accessibility like at the festival?\",\"Answer\":\"The festival site is made up of varying terrain, some of which is quite rugged and steep and may be difficult for some to safely navigate. If you have any questions or concerns about accessibility at Welcome to Nowhere please feel free to get in touch at \\u003ca href=\\\"mailto:eyegum.music@gmail.com\\\"\\u003eeyegum.music@gmail.com\\u003c/a\\u003e\",\"Order\":\"13\"}},{\"id\":\"recdH08DhiXDzRqto\",\"created_at\":\"2021-07-29T04:30:16.000Z\",\"updated_keys\":[],\"fields\":{\"Question\":\"This all sounds great, I can’t wait! When does it start?\",\"Answer\":\"The main event runs across Saturday 5 and Sunday 6 February 2022, but you can arrive as early as 3pm on Friday afternoon to snag a good camp spot and enjoy a mini programme of entertainment to get you in the mood for the weekend's revelries. Once you’re there you can stay until Monday, and since it’s a public holiday there’s no need to rush back home.\",\"Order\":\"20\"}},{\"id\":\"recfW5p7ol1XZRY5G\",\"created_at\":\"2021-07-29T04:21:06.000Z\",\"updated_keys\":[],\"fields\":{\"Question\":\"Can I bring my kids?\",\"Answer\":\"You sure can. Welcome to Nowhere is a family-friendly festival, so long as all children under 18 are accompanied by a guardian/parent. You will need to purchase a free ticket for your child through our ticketing system after selecting a general admission ticket. It's your responsibility to supervise your kids at all times as there are a number of hazards around the site.\",\"Order\":\"6\"}},{\"id\":\"rechTu2JTDivlZSuK\",\"created_at\":\"2021-07-29T04:19:08.000Z\",\"updated_keys\":[],\"fields\":{\"Question\":\"Can I bring my dog?\",\"Answer\":\"Yes. Welcome to Nowhere is a dog friendly festival but please make sure your pup is well socialised and is supervised at all times. We don’t want any cases of biting dogs!\",\"Order\":\"5\"}},{\"id\":\"reclR2P9Vx7RCxf7z\",\"created_at\":\"2021-07-29T04:26:33.000Z\",\"updated_keys\":[],\"fields\":{\"Question\":\"What food and drink is available?\",\"Answer\":\"There will be a handful of vendors selling food and non-alcoholic drinks which will be announced soon. Make sure you bring plenty of cash as there is no EFTPOS on site. It's a good idea to bring your own food/snacks in case the vendors sell out.\",\"Order\":\"12\"}},{\"id\":\"reclnpMlYdEEr7UsN\",\"created_at\":\"2021-09-22T22:49:41.000Z\",\"updated_keys\":[],\"fields\":{\"Question\":\"Can I drive there or catch public transport?\",\"Answer\":\"This year we have introduced a parking pass ticket. If you are driving a vehicle to the festival you need to purchase a parking pass through our ticketing system. If you bring 2 or more passengers in your car, this parking pass will be fully refunded a few days after the festival is over. We want to encourage carpooling to reduce our carbon footprint and cut down on the amount of space reserved for parking. \\u003ca href=\\\"https://www.groupcarpool.com/t/gnzeqi\\\"\\u003eYou can access our carpooling database here\\u003c/a\\u003e\\n\\nYour parking pass won't be refunded if you have less than 2 passengers.\\n\\nThere is no public transport to the festival but you can always catch a bus to Whanganui and see if somebody can drive you the rest of the way.\\n\\nPlease note: If you are bringing a campervan or van to sleep in you don't need to purchase a parking pass. You can purchase a free campervan/van pass. However, these are limited and you must meet the definition of a campervan/van to redeem this pass.\",\"Order\":\"7\"}}]",
