    "[{\"id\":\"rec0Rg8p1t3EJYPwd\",\"created_at\":\"2021-09-06T03:56:58.000Z\",\"updated_keys\":[],\"fields\":{\"Bio (Extended)\":\"Since launching in 2018, Beacon Bloom are fast becoming one of New Zealand's most sought after electronic acts.\\n‍\\nAfter being booked for Electric Avenue, Esoteric (Aus), Shipwrecked and Cuba Dupa the band's 8th ever show was on the main stage of Rhythm and Alps - a headline-timeslot after midnight on New Years Eve.\\n‍\\nTaking inspiration from the best of European nightlife, the genre-fluid outfit continue to push the boundaries of music and multimedia in both the virtual and physical worlds.\",\"Hometown\":\"Ōtautahi / Christchurch\",\"Bio\":\"Psychedelic Space Disco - Handmade by Band in Otautahi, New Zealand\",\"Please provide links to your social channels\":\"facebook.com/beaconbloom\\ninstagram.com/beaconbloom\\nsoundcloud.com/beaconbloom\\n\",\"Links\":\"https://open.spotify.com/artist/7ecriBfYo3KBxbNspB0Tcc?si=JvIce4ODSViFj_dBq5hxMg\",\"Name\":\"Beacon Bloom\",\"Portrait Press Shot\":[{\"id\":\"attnzzzQzv1LzAF4Z\",\"width\":1080,\"height\":1080,\"url\":\"https://dl.airtable.com/.attachments/c5d516afb3d26f311d88e6d299c1d86e/1c5a5776/beacon-bloom.jpg?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=f10edc16d954c4c7\",\"filename\":\"beacon-bloom.jpg\",\"size\":260477,\"type\":\"image/jpeg\",\"thumbnails\":{\"small\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/23e2b791e806c5a9c5ceafff23441f1f/2c62f200?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=d5f545b1255f4047\",\"width\":36,\"height\":36},\"large\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/9a7124e867878cf412f54cdebdc64a57/b7ee6e00?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=e4b8e932e10bfeb3\",\"width\":512,\"height\":512},\"full\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/11ed979ae1238736e26e1eb4817e6d7f/22c52a51?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=ea6eccd63da403c8\",\"width\":3000,\"height\":3000}}}],\"Genre\":\"Electronic\",\"Application Type\":\"Music\"}},{\"id\":\"rec4fR5XnlWduePmh\",\"created_at\":\"2021-08-04T04:56:07.000Z\",\"updated_keys\":[],\"fields\":{\"Bio (Extended)\":\"Initially the solo-project of Peter Ruddell (Wax Chattels), Sulfate quickly expanded into a band — first, with David Harris (Jonathan Bree / Princess Chelsea) on Drums, and now with Hariet Ellis (Na Noise / Dick Move) on bass guitar and vocals. \\n\\nThe group released their self-titled album in 2019, marking “a significant first step for Sulfate and definitely demands wider attention beyond the project's DIY roots\\\" (UndertheRadar). With NZ and Australia tours they quickly developing a reputation for \\\"startling, sonorous...crushing yet considered\\\" live performances (AmbientLightBlog). \\n\\nTheir second record, 'Godzone', released in September 2021 on Flying Nun Records — fully displays their \\\"intensity through restraint\\\" ethos, with its sights firmly set on New Zealand's social conscience. With waves of distorted bass over funereal tempos, driving krautrock drums with chord changes that seem to last an age, and swirling textures supporting cutting lyrics and commanding delivery — this is band that needs to be experienced live. \",\"Hometown\":\"Tāmaki Makaurau / Auckland\",\"Bio\":\"Dark, heavy and cathartic\",\"Please provide links to your social channels\":\"https://www.instagram.com/sulfate_band\\nhttps://www.facebook.com/sulfateband\",\"Links\":\"https://sulfate.bandcamp.com/\",\"Name\":\"Sulfate\",\"Portrait Press Shot\":[{\"id\":\"att3HqaFxzZFHndNM\",\"width\":1080,\"height\":1080,\"url\":\"https://dl.airtable.com/.attachments/c941d561c711e1045ce9c4bb6636cec1/da2bc9e5/sulfate.jpg?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=34bf3a5133c60890\",\"filename\":\"sulfate.jpg\",\"size\":454313,\"type\":\"image/jpeg\",\"thumbnails\":{\"small\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/1fe54da74163f9ab1b4187d133891828/a24c956b?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=d80db809ed906158\",\"width\":36,\"height\":36},\"large\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/6285927c2d785d51b6f197c67fc86e45/ebf19371?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=01dfa69b35925d4d\",\"width\":512,\"height\":512},\"full\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/9176ab272148300b4ec2e37d4d7e7e39/5245da75?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=db3d2fe087392d1f\",\"width\":3000,\"height\":3000}}}],\"Genre\":\"Alt/Slowcore/Noise-rock\",\"Application Type\":\"Music\"}},{\"id\":\"rec7e3mUMOL73VZNV\",\"created_at\":\"2021-10-04T03:28:29.000Z\",\"updated_keys\":[],\"fields\":{\"Bio (Extended)\":\"Castlecliff lights emerged after an unusual series of psychological adventures culminating in the observation of some suspicious sparkles in the sky off the coast of Castlecliff. Their set is appropriately characterised by a constant shifting of dynamic. Castlecliff Lights began as a solo project created by Ellen Young and has evolved into what it was always meant to be... it was just waiting for the rest of the band to show up. Helen John and Ross bring their own perspectives to the sound which culminates in an assortment of wall of noise landscapes, moments of wistful space and some heavier reckless abandon.\",\"Hometown\":\"Whanganui\",\"Name\":\"Castlecliff Lights\",\"Portrait Press Shot\":[{\"id\":\"attw7xgTQXUPqOSMZ\",\"width\":1080,\"height\":1080,\"url\":\"https://dl.airtable.com/.attachments/06d175ce81922a107f34ba0d47114223/2ddf09e9/castlecliff-lights.jpg?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=9e545b69629d4770\",\"filename\":\"castlecliff-lights.jpg\",\"size\":345902,\"type\":\"image/jpeg\",\"thumbnails\":{\"small\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/88b39691093088fbfa69dd736ad1bec4/7a1ae300?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=380c4d38679375b0\",\"width\":36,\"height\":36},\"large\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/67f1d030124f9478a6a58f7ba744dd62/9dc58263?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=7f44f883458762b9\",\"width\":512,\"height\":512},\"full\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/99b6cc36e951cc63167b05e55beb24c4/bb31833b?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=e32965d8481d2ce1\",\"width\":3000,\"height\":3000}}}],\"Genre\":\"Psych Ethereal Durge-rock\"}},{\"id\":\"rec804Hpn8riBvVav\",\"created_at\":\"2021-09-06T03:23:04.000Z\",\"updated_keys\":[],\"fields\":{\"Bio (Extended)\":\"Wellington based DESTROY WITH SCIENCE does everything the hard way — building bangers from scratch on a handcrafted rig of hardware synths and samplers. By attending this performance, you consent to participate in an aural experiment where side effects may include involuntary shuffling, head bobbing, and in many cases, erratic hand movements. Anything could happen... but you would be forgiven for identifying similarities to the music genre known as TECHNO!\",\"Hometown\":\"Pōneke / Wellington\",\"Bio\":\"Ethereal eartingles and bootleg bangers coming at you live and direct\",\"Please provide links to your social channels\":\"https://www.facebook.com/destroywithscience\\nhttps://www.instagram.com/destroywithscience/\",\"Links\":\"https://destroywithscience.bandcamp.com/\",\"Name\":\"Destroy With Science\",\"Portrait Press Shot\":[{\"id\":\"att5ca01WymwPYUH7\",\"width\":1080,\"height\":1080,\"url\":\"https://dl.airtable.com/.attachments/183777d7ab5d45152bd5119b30e2fcdf/c3570535/destroy-with-science.jpg?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=32906ff26a1b3e37\",\"filename\":\"destroy-with-science.jpg\",\"size\":261421,\"type\":\"image/jpeg\",\"thumbnails\":{\"small\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/f3114fca652991a00ae17ad6c661dc23/76110271?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=131cb8dd5124a7dd\",\"width\":36,\"height\":36},\"large\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/6be9685ba8bc3efeb6d8c93b3f7f31e8/97e19f8a?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=973ab3fb95b556b5\",\"width\":512,\"height\":512},\"full\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/e102a68382547389e134b0e2d0d5ad6f/c9e7db60?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=6ff022acf079c9c0\",\"width\":3000,\"height\":3000}}}],\"Genre\":\"Electric Space Drop\",\"Application Type\":\"Music\"}},{\"id\":\"rec8m5tOWmFlZgFkL\",\"created_at\":\"2021-10-27T21:14:21.000Z\",\"updated_keys\":[],\"fields\":{\"Bio (Extended)\":\"The Shocking and Stunning are Jack Hooker (synths/sampler/effects) and Sam Lovrich-FitzPatrick (drums). Described by Martyn Pepperell in VanguardRed Magazine as “emotive, physically propulsive and above all, f***ing epic”, they combine densely layered synths and heavy live drums to make wall-of-sound music that sits between dance, trance, noise and drone.\\n\\nThe Shocking and Stunning were most in the early 2010's. In that time they released six EPs, scored a documentary, collaborated with rappers Tourettes and Name UL, toured numerous times throughout New Zealand and Australia, performed at festivals such as Camp A Low Hum and Rhythm and Alps, and played many house parties. Since then the band have made sporadic festival appearances, and In 2019 they released their long-overdue debut full-length album. \",\"Hometown\":\"Pōneke / Wellington\",\"Bio\":\"Just a couple of unlikeable fucks who make music together.\",\"Please provide links to your social channels\":\"https://www.facebook.com/theshockingandstunning\",\"Links\":\"https://theshockingandstunning.bandcamp.com/\",\"Name\":\"The Shocking and Stunning\",\"Portrait Press Shot\":[{\"id\":\"attyRdNniNPnk5kGO\",\"width\":1080,\"height\":1080,\"url\":\"https://dl.airtable.com/.attachments/2fd7057763dc72bb6aa7590af8a8823f/777db935/the-shocking-and-stunning.jpg?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=2aa32cf7f942ab82\",\"filename\":\"the-shocking-and-stunning.jpg\",\"size\":555986,\"type\":\"image/jpeg\",\"thumbnails\":{\"small\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/167473a0a6f9f22dc7a5dcc03e9942bc/7a0e249c?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=ef0eae3d2937a389\",\"width\":36,\"height\":36},\"large\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/61df7cb0680e2b425e62a53b252a9f62/668ac214?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=e76f0162a7f8141c\",\"width\":512,\"height\":512},\"full\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/9a57c70b464d55e6d106d1fe8820f903/24bf50d4?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=e091988a01c57901\",\"width\":3000,\"height\":3000}}}],\"Genre\":\"Electro Doom\"}},{\"id\":\"recAr3Pt1Uj63rtnv\",\"created_at\":\"2021-10-27T21:14:23.000Z\",\"updated_keys\":[],\"fields\":{\"Bio (Extended)\":\"Vera Ellen is an artist from Te Whanganui-a-Tara/LA who writes catchy and poignant indie rock/pop tunes. Her new album It's Your Birthday is out now on Flying Nun Records.\",\"Hometown\":\"Pōneke / Wellington\",\"Please provide links to your social channels\":\"https://veraellen.bandcamp.com/\",\"Links\":\"https://veraellen.bandcamp.com/\",\"Name\":\"Vera Ellen\",\"Portrait Press Shot\":[{\"id\":\"attxnEsrB6roX5F9b\",\"width\":1080,\"height\":1080,\"url\":\"https://dl.airtable.com/.attachments/93ff0a8cd5c87d3740cd2760d7221435/9b027f05/vera-ellen.jpg?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=7e8fc89703b2880d\",\"filename\":\"vera-ellen.jpg\",\"size\":651522,\"type\":\"image/jpeg\",\"thumbnails\":{\"small\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/e1363823551257c6ba050714dc4f6419/e27d2f24?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=8199b22935d58773\",\"width\":36,\"height\":36},\"large\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/7a66869fd509e074bab20c946fbc6502/585bcc0c?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=62f7a1aab8a61499\",\"width\":512,\"height\":512},\"full\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/eda96e5bf48d325f55a871517e531209/5c7185f1?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=da4f4b6b61358cd1\",\"width\":3000,\"height\":3000}}}],\"Genre\":\"Indie rock\",\"Application Type\":\"Music\"}},{\"id\":\"recD7JMuN5bilvdii\",\"created_at\":\"2021-08-04T04:56:07.000Z\",\"updated_keys\":[],\"fields\":{\"Bio (Extended)\":\"Keepsakes, the alias of British-New Zealand producer and DJ James Barrett, has been a strong and distinctive voice in techno in recent years, showcasing his powerful and menacing, yet often cheeky and playful, productions on influential labels including South London Analogue Material, Perc Trax, and MORD.\\n\\nFurthermore, he co-founded the Haven club night in Tāmaki Maraukau in 2015 - introducing the experimental and harder side of techno to the city. In 2018 Haven expanded into a record label - releasing leading international artists including VTSS, Tommy Holohan, New Frames, Peder Mannerfelt, and Ansome, as well as becoming the main home for Barrett’s own productions.\\n\\nNow located in Ōtautahi - following several years in Berlin hitting the European club circuit - he is focused on bringing his tough and eclectic sound to dance floors worldwide, with regular appearances at international techno institutions providing a platform for his formidable vinyl DJ sets.\",\"Hometown\":\"Ōtautahi / Christchurch\",\"Bio\":\"Keepsakes is a techno producer from Ōtautahi that has been making big waves in the international techno scene since his first releases in 2014.\",\"Please provide links to your social channels\":\"https://www.facebook.com/keepsakesish\\nhttps://www.instagram.com/keepsakesish\\nhttps://soundcloud.com/keepsakes\",\"Links\":\"https://soundcloud.com/keepsakes \",\"Name\":\"Keepsakes\",\"Portrait Press Shot\":[{\"id\":\"attU7YcL9Nft3wpYB\",\"width\":1080,\"height\":1080,\"url\":\"https://dl.airtable.com/.attachments/65811f950fe5fa7b6a070e4f39619fdf/5bcb33bd/keepsakes.jpg?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=1a39b6e824ba0e45\",\"filename\":\"keepsakes.jpg\",\"size\":287681,\"type\":\"image/jpeg\",\"thumbnails\":{\"small\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/f0406918f9f69b51f9c5b075dd9ba615/7ad31baf?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=4f016b9b5cf1754d\",\"width\":36,\"height\":36},\"large\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/7231c6b22012edc3b2a0510d9d36ad7c/c582713d?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=f152367a9d12a6b9\",\"width\":512,\"height\":512},\"full\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/a1e9a3351c65a42ed9477ff123d717f9/1b633fbd?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=a32478ede9b23bab\",\"width\":3000,\"height\":3000}}}],\"Genre\":\"Techno\"}},{\"id\":\"recFllGHY7wSrBhFC\",\"created_at\":\"2021-08-04T04:56:07.000Z\",\"updated_keys\":[],\"fields\":{\"Bio (Extended)\":\"MOUSEY is the project of Christchurch songwriter Sarena Close. With a strong sense of melody and emotionally raw sincerity, Mousey cherishes the art of communicating the human experience above all else. She is inspired by artists such as Thom Yorke, Regina Spektor, Paul McCartney, Angel Olsen and Sufjan Stevens. And yet her sound defies the restrictions of genre and her music provides a unique and powerful insight into this wonderful and confusing world. Mousey’s live performance is not to be forgotten either. Her vocals stand alone like few others, and listeners find themselves drawn in - transfixed by her songs and the way she tells them.\",\"Hometown\":\"Ōtautahi / Christchurch\",\"Bio\":\"Soul wrenching wailing and cute rocky bops, Mousey mashes all the things she loves into a beautiful indie mess. \",\"Please provide links to your social channels\":\"www.instagram.com/mouseyindahousey\\nwww.facebook/com/mouseynz\",\"Links\":\"https://www.mouseynz.bandcamp.com\\n\",\"Name\":\"Mousey\",\"Portrait Press Shot\":[{\"id\":\"attUyU9pEgjRt4AZD\",\"width\":1080,\"height\":1080,\"url\":\"https://dl.airtable.com/.attachments/00907bbdfdd872e728823468414d9dfa/f9b6297d/mousey.jpg?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=fb21c9c2a83aeae9\",\"filename\":\"mousey.jpg\",\"size\":581094,\"type\":\"image/jpeg\",\"thumbnails\":{\"small\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/6685b70e9527d362418fae4d5f190295/206e9307?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=4223f5f84fad0b42\",\"width\":36,\"height\":36},\"large\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/2233a010511f999450483e3aa2f65806/21018385?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=6f1083d2a916c0c1\",\"width\":512,\"height\":512},\"full\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/14bc05b9ffc34aa84903b2baad2d26d7/46168af4?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=edc3f3bd5b43a3fb\",\"width\":3000,\"height\":3000}}}],\"Genre\":\"Shrek Indie\",\"Application Type\":\"Music\"}},{\"id\":\"recK0SusmhTKJvbYX\",\"created_at\":\"2021-08-04T04:56:07.000Z\",\"updated_keys\":[],\"fields\":{\"Bio (Extended)\":\"Expanding from their ambient-dance synth-duo and ready for harvest, Grains have emerged as an explosive 5-piece ensemble of electro-acoustic energies. Technicolour spaces of synth-pad sequences (Peregrin Hyde), dreamy guitar licks (Jed Prickett) and ethereal throat singing (Fredd Marshall) give way to rising cosmic crescendos driven by punchy sub-bass (Calum Turner) and ecstatic, rising rhythms (Jared Reynolds).\\n\\n\",\"Hometown\":\"Pōneke / Wellington \",\"Bio\":\"Live synthesised beats to play battleships, eat cereal \\u0026 transcend to.\",\"Please provide links to your social channels\":\"instagram.com/grains_nz\\nfacebook.com/grainsnz\\ngrainsnz.bandcamp.com/releases\\nsoundcloud.com/grainsnz\\n\",\"Links\":\"https://www.youtube.com/watch?v=NfqkMEU0IaU\\u0026t\",\"Name\":\"Grains\",\"Portrait Press Shot\":[{\"id\":\"attKBKLMvv5WE4jkV\",\"width\":1080,\"height\":1080,\"url\":\"https://dl.airtable.com/.attachments/79ff1bc4575ace153516992f2b0c09aa/c3eba718/grains2.jpg?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=140ae5c6d840c51b\",\"filename\":\"grains2.jpg\",\"size\":282241,\"type\":\"image/jpeg\",\"thumbnails\":{\"small\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/1f85820a0c738199bb5e4170ee28038b/3384776c?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=0b9217288ddf77f3\",\"width\":36,\"height\":36},\"large\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/a315ecfebd022026d7b28605f3a3b3c4/99a9aca2?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=b6c9b902f261d7aa\",\"width\":512,\"height\":512},\"full\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/22fb969ee76876c5787eb1656506ff1f/41a1dd25?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=b5ddfb6e86a5e034\",\"width\":3000,\"height\":3000}}}],\"Genre\":\"Genre-fluid Progressive\",\"Application Type\":\"Music\"}},{\"id\":\"recLVXURGo3flbma9\",\"created_at\":\"2021-09-06T03:57:00.000Z\",\"updated_keys\":[],\"fields\":{\"Bio (Extended)\":\"Bursting with melodies of hope-filled melancholy, BEING. is the indie-rock project of Tāmaki Makaurau songwriter Jasmine Balmer. Known for their dynamic live performances, BEING. interweaves illustrative lyric and a dream-guitar-pop aesthetic, with poetry excerpts on occasion. Their vibrant arrangements range from solo to full-band expressions with the support of talented friends Joshua Worthington-Church (Galaxy Bear), Simeon Kavanagh-Vincent (Lucky Boy^), Tom Broome (Homebrew), and JY Lee (Avantdale Bowling Club). Lush layers and drones \\\"pressed through tumbling guitars\\\" create the \\\"crushingly tender\\\" soundscape that is BEING.\",\"Hometown\":\"Tāmaki Makaurau / Auckland\",\"Bio\":\"“Crushingly tender, open-hearted indie-pop, with clear-eyed lyrics pressed through tumbling guitars and the magnetic vocal tone of Balmer.” - Eliana Gray\",\"Please provide links to your social channels\":\"https://www.instagram.com/being.hermusic/\\nFB: https://www.facebook.com/being.hermusic/ \",\"Links\":\"https://open.spotify.com/artist/1Vcrjl1W6q10u9jOatHBhd?si=6VcO5SLfRMmuUBuGcaIOMw\\u0026dl_branch=1\",\"Name\":\"BEING.\",\"Portrait Press Shot\":[{\"id\":\"attvI3vQugzjzeGkp\",\"width\":1080,\"height\":1080,\"url\":\"https://dl.airtable.com/.attachments/b99dfd1119a8eee0ac5743f18678e958/ff57a0f6/being.jpg?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=795768d37a77b53e\",\"filename\":\"being.jpg\",\"size\":374111,\"type\":\"image/jpeg\",\"thumbnails\":{\"small\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/ea20c9250b84e76a2f5b091520a144e5/366fcb5d?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=e156fe59884bb152\",\"width\":36,\"height\":36},\"large\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/365fcc834cf14ee35c2126ddfb99b51d/4eeb5626?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=2957cfade6ca4117\",\"width\":512,\"height\":512},\"full\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/e47fdcaf81a3b3ba03df9eb9b509a37e/59db673b?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=0aa4700b62bc770a\",\"width\":3000,\"height\":3000}}}],\"Genre\":\"Dream Guitar Pop\"}},{\"id\":\"recMTSsl0sasNFUeM\",\"created_at\":\"2021-10-27T21:14:08.000Z\",\"updated_keys\":[],\"fields\":{\"Bio (Extended)\":\"Hailing from Mount Erebus DAFM (Destroy All False Metal) are a bevy of Bubble Punk Bratz ready to ice you over. After a set you won’t feel the same again. Symptoms range from a growing affinity for tai sweet chilli cassava chips to a looming UTI. DAFM offers head banging riffs and palpable sexual tensions you won’t want to miss.\",\"Hometown\":\"Pōneke / Wellington\",\"Bio\":\"DAFM are a gross live beast. \",\"Please provide links to your social channels\":\"https://www.facebook.com/destroyallfalsemetal\",\"Links\":\"https://dafmband.bandcamp.com/\",\"Name\":\"DAFM\",\"Portrait Press Shot\":[{\"id\":\"attBEurBWw58rAUUQ\",\"width\":1080,\"height\":1080,\"url\":\"https://dl.airtable.com/.attachments/ca511f44fcfbddce5a175cbae70ba7ad/3577c36b/dafm.jpg?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=e6ab287083aafa7d\",\"filename\":\"dafm.jpg\",\"size\":527874,\"type\":\"image/jpeg\",\"thumbnails\":{\"small\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/fe298bd37bf2664c52cc018434b83dd7/5f1e2072?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=1fc9c04b67c61c62\",\"width\":36,\"height\":36},\"large\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/9f3de4396983225fd6bd62b7ec52bff0/e92c77c5?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=d564416b3f5cac72\",\"width\":512,\"height\":512},\"full\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/c083e94852ebb5d43d506fb76e1b228c/90543d56?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=97977497ea2547e6\",\"width\":3000,\"height\":3000}}}],\"Genre\":\"Bubble-punk\"}},{\"id\":\"recMXczQdz8KhoD2M\",\"created_at\":\"2021-08-04T04:55:20.000Z\",\"updated_keys\":[],\"fields\":{\"Bio (Extended)\":\"Wurld Series was founded by Luke Towart, a British expatriate with strong familial ties to New Zealand, when he moved to Christchurch from Lancashire, England in 2012. Two EPs of loner bedroom pop followed - Lunch Songs first and later Pool Food - which were compiled on a debut US release in 2016 - a collection of early highlights titled Anthology via Portland tape label Voyager Golden Records. A single from this release, 'Oh Well', led Radio New Zealand to declare that the band represented 'New Zealand DIY done at it's very best'. During this period Wurld Series became more active live and toured New Zealand in support of their first album Air Goofy and the follow-up EP Stately and Befrothed. From this point on Towart has seen Wurld Series as less of a band and more of a music-making guild, with a changing line-up that depends on who is present for recording sessions at the band's lock-up space in the industrial suburb of Woolston. \\n\\nWurld Series’ second album, What’s Growing, has garnered international acclaim. Bandcamp Daily labelled What’s Growing an ‘Essential Release’ of 2021 and the album was the subject of a glowing review on Pitchfork, who proclaimed that ‘The New Zealand indie rock band’s thoughtful, witty, and brief songs pit surrealism against the malaise of workaday life.’ \",\"Hometown\":\"Ōtautahi / Christchurch\",\"Bio\":\"Wurld Series are an indie rock band from Christchurch. Known for their skewed pop sensibility, psych-folk cred and lo fi production aesthetic.\",\"Please provide links to your social channels\":\"https://m.facebook.com/wurldseries/\",\"Links\":\"https://wurldseires.bandcamp.com\",\"Name\":\"Wurld Series\",\"Portrait Press Shot\":[{\"id\":\"att8lYMhnSpN6alIY\",\"width\":1080,\"height\":1080,\"url\":\"https://dl.airtable.com/.attachments/308ff4f44958b77bd7dddbdcf7111678/630f9ef8/wurld-series.jpg?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=591185001db1a16a\",\"filename\":\"wurld-series.jpg\",\"size\":616875,\"type\":\"image/jpeg\",\"thumbnails\":{\"small\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/77ac6bebf683dad6d92b3c607629d59e/ad145f98?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=aca397c520194d89\",\"width\":36,\"height\":36},\"large\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/7ab1ea019d3b950da9c3927053277edc/4f3e182b?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=7700f8ed8ea6a4e5\",\"width\":512,\"height\":512},\"full\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/c67c63bef99882d29d5255d32827b55d/bb9718b3?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=dc0fca8eb285c36d\",\"width\":3000,\"height\":3000}}}],\"Genre\":\"Indie Rock\"}},{\"id\":\"recN23snNNnCA1wLE\",\"created_at\":\"2021-08-04T04:56:07.000Z\",\"updated_keys\":[],\"fields\":{\"Bio (Extended)\":\"Egovalve was originally formed in 2015, in a corrugated iron shed in Ōtautahi by shredder-by-day, crooner-by-night Luke Lament (SOG) and bassist Jack Diamond (Jalapeño Poppers) writing 60s-inspired garage rock riffs and jangly songs about growing up in provincial Aotearoa. After a move to Pōneke, Egovalve capped off the current lineup with local non-binary muso Tasmin (Lilith) jumping on drums. Since then, Egovalve has evolved into a tightly-fused, white-hot trio with influences ranging from the Zombies to Iggy Pop. \",\"Hometown\":\"Pōneke / Wellington \",\"Bio\":\"Egovalve is a groovy, fuzzy three-piece kaleidoscope of sound blending 60s garage and indie spook with post-earthquake Ōtautahi musings. \",\"Please provide links to your social channels\":\"https://www.facebook.com/EgoValve\\nhttps://www.instagram.com/egovalveofficial/\\n\",\"Links\":\"https://open.spotify.com/artist/3ZScwlFe0NE70oA9qv13c2?si=V1HRYG_OTK6g5bnOoBcYhw\\u0026dl_branch=1\",\"Name\":\"Egovalve\",\"Portrait Press Shot\":[{\"id\":\"attR6pM9jNFLi6Pnh\",\"width\":1080,\"height\":1080,\"url\":\"https://dl.airtable.com/.attachments/d27480c0d8346eccb54d6eeccddd3a88/af55faa1/egovalve.jpg?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=1c7340f34c150e4f\",\"filename\":\"egovalve.jpg\",\"size\":262208,\"type\":\"image/jpeg\",\"thumbnails\":{\"small\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/15ffb2bcc53f94f706c9411584cc7a1d/3308db4a?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=5f928e0914210f52\",\"width\":36,\"height\":36},\"large\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/0c9cc43c3452889467766696786f880b/c4457eb9?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=74141698e5ff570f\",\"width\":512,\"height\":512},\"full\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/c13c42aa1f9fc12ba337cee5f6a197dc/08c2135b?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=b7dbd2c49c73f1a9\",\"width\":3000,\"height\":3000}}}],\"Genre\":\"Garage Rock/Indie Rock \",\"Application Type\":\"Music\"}},{\"id\":\"recPOZaQfScxK