ing into your nature, releasing and finding power. Now based in Pōneke, Violet is joined by Phoebe Johnson (Revulva), Hikurangi Schavien-Kaa (French for Rabbits +everything), and Logan McAllister (Cold Ceiling, Macho Macho) who help illustrate these modern ballads.\",\"Hometown\":\"Pōneke / Wellington\",\"Bio\":\"Violet makes music mostly in Te Whanganui-a-Tara by herself. She likes fatal romance, nostalgia, force of nature and balancing power. Illustrated with the help of Phoebe Johnson, Hikurangi Schavien-Kaa and Logan McAllister. \",\"Please provide links to your social channels\":\"https://www.instagram.com/violethirst/\\nFacebook: https://www.facebook.com/hirstviolet\\nBandcamp: https://violethirst.bandcamp.com/\\nSoundcloud: https://soundcloud.com/violethirst\\nYouTube: https://www.youtube.com/watch?v=W6eObe0eJJs \",\"Links\":\"https://violethirst.bandcamp.com/\",\"Name\":\"Violet Hirst\",\"Portrait Press Shot\":[{\"id\":\"attBPVr9005oW0cre\",\"width\":1080,\"height\":1080,\"url\":\"https://dl.airtable.com/.attachments/3fdabdb368a55aaa127cfa7d098572c3/6c960d8f/violet-hurst.jpg?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=fe14a94e42285302\",\"filename\":\"violet-hurst.jpg\",\"size\":426973,\"type\":\"image/jpeg\",\"thumbnails\":{\"small\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/fb181cd2d8fefd33a32c0ec66a11a38e/4cf860db?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=a3ad0cc35d76d9ec\",\"width\":36,\"height\":36},\"large\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/accb42d914573ecb52c917b551ab08c5/94658159?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=46a4f9de658c3066\",\"width\":512,\"height\":512},\"full\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/774fe1a619b99a6ed31eba4a44013805/01eecf9f?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=fd9ed2f973658cd1\",\"width\":3000,\"height\":3000}}}],\"Genre\":\"Folk/Rock/Pop\",\"Application Type\":\"Music\"}},{\"id\":\"recQ27csiMdHmFDL4\",\"created_at\":\"2021-08-04T04:56:07.000Z\",\"updated_keys\":[],\"fields\":{\"Bio (Extended)\":\"Gulls is the culmination of two musical flavours: the songwriting of Adam Stewart and the rhythm section of a band called Maryland. When the three musicians met in Dunedin a couple years ago they played a few shows together and really liked the idea - leading to studio workouts and many heavy, wafting jams - the trio are set to explore a more ambient vibe in the coming year\",\"Hometown\":\"Whanganui\",\"Bio\":\"gulls live band is a sad yet beautiful journey into the forgotten \",\"Please provide links to your social channels\":\"https://www.facebook.com/gullsorgulls\",\"Links\":\"https://soundcloud.com/gullsmusic001/albums\\n\",\"Name\":\"Gulls\",\"Portrait Press Shot\":[{\"id\":\"attDsPChcTzkcakwl\",\"width\":1080,\"height\":1080,\"url\":\"https://dl.airtable.com/.attachments/83b0b980d7ac300d0dc2c81e8a05015e/ad039430/gulls.jpg?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=c78a921468a67cf4\",\"filename\":\"gulls.jpg\",\"size\":218908,\"type\":\"image/jpeg\",\"thumbnails\":{\"small\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/34506e27d2d1d4e2e709b9eca3725945/98a4b20e?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=0f27f3637cbbbf6b\",\"width\":36,\"height\":36},\"large\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/3e01519e59290e8e368d52ab8a293f07/abee731f?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=f4e85745d673f3f0\",\"width\":512,\"height\":512},\"full\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/6f7b5707c3115f6013404c8b98e92c6a/73cec5ac?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=26101b3666de24b9\",\"width\":3000,\"height\":3000}}}],\"Genre\":\"Folk-tronica\",\"Application Type\":\"Music\"}},{\"id\":\"recQCd654Yuq7bDQk\",\"created_at\":\"2021-10-27T21:14:18.000Z\",\"updated_keys\":[],\"fields\":{\"Bio (Extended)\":\"Revulva is here to bring huge grins to your knees on the d-floor. Nu-wave, nu-jazz, nu-pop goodness brought to you by chefs Phoebe Johnson (Ski Resort), Lily Rose Shaw (Odessa), Hector McLachlan (Forest Music), Zane Hawkins (Sky Canvas), Toby Leman (Hummucide), Hugo Olsen-Smith (Hummucide), Hayden Richardson (Dr. Reknaw) and Olivia Campion (Yumi Zouma). This 8-piece groovy family are have been boogying together since July 2020, and since then have kicked up a storm by opening for Cloak Bay for Tora Bombora’s sound check show, touring the top of the South Island for Twisted Frequency Festival, and releasing their first singles “Sniffly Lady” and \\\"Tuning Out\\\" early 2021. \\n\\nCiting references such as The Talking Heads, Steely Dan, Minnie Riperton and Prince - Revulva is when jazz, pop and the new wave collide. \\tTheir live sound is an exciting, theatrical, and an all encompassing bodily experience. Revulva are not afraid to use their weapons of a powerful horn section (Leman, Shaw, Olsen-Smith, and Richardson), an impossibly groovy rhythm section (Hawkins, McLachlan, and Campion) and dramatic performance from the band’s leader, vocalist and bass player, Phoebe Johnson. \\n\\nThe members of Revulva were united at Te Koki, New Zealand School of Music where they all studied jazz performance. While they have not been playing together long, they anticipate releasing a larger body of work late 2021. \\n\",\"Hometown\":\"Pōneke / Wellington\",\"Bio\":\"Revulva is here to bring huge grins to your knees on the d-floor. Prepare to get loose with Pōneke's family of eight with some nu-jazz, nu-wave, nu-pop goodness. \",\"Please provide links to your social channels\":\"facebok.com/regardingvulva\\n@revulvamusic \",\"Links\":\"https://open.spotify.com/artist/478agCaHgiqDySnHUBzqGS?si=xH0SZZP-QfS8NfhOBp7lqw\\n\",\"Name\":\"Revulva\",\"Portrait Press Shot\":[{\"id\":\"att1D1IuA8gprkpaZ\",\"width\":1080,\"height\":1080,\"url\":\"https://dl.airtable.com/.attachments/822152e3ba3afcda15634e257d14c1a7/8d441ef7/revulva.jpg?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=0c026df75254f69b\",\"filename\":\"revulva.jpg\",\"size\":445228,\"type\":\"image/jpeg\",\"thumbnails\":{\"small\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/bb5ccfa697ed7aeb94d1d49e75811369/901f6488?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=ee830a6b861b395e\",\"width\":36,\"height\":36},\"large\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/e3272613792d64bb5e2ee4fca2cbb4e3/91cb7ed2?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=990bf8db94f8f3c6\",\"width\":512,\"height\":512},\"full\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/f44e1ebf22dfba6ea6025db506ce6dab/054e9603?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=0a1cc9866eb94dda\",\"width\":3000,\"height\":3000}}}],\"Genre\":\"Nu-jazz\",\"Application Type\":\"Music\"}},{\"id\":\"recSo57Uxflp4E8mN\",\"created_at\":\"2021-08-04T04:56:07.000Z\",\"updated_keys\":[],\"fields\":{\"Bio (Extended)\":\"Dale Kerrigan (a band, there is no-one called Dale Kerrigan in the 4 piece group) is the brainchild of Ōtepoti/ Dunedin musician Shlee Nicholls (Mary Berry, Flesh Bug), another from the noisy Nicholls family production line of musicians, alongside hyperactive drumming brother Josh Nicholls (Koizilla, Fazed on a Pony, Asta Rangu, Space Bats, Attack! et al.) and friends Joel Field (Porpoise), and Connor Blackie (Koizilla, Adelaide Cara).\",\"Hometown\":\"Ōtepoti / Dunedin\",\"Bio\":\"Dale Kerrigan (a band, there is no-one called Dale Kerrigan in the 4 piece group) is the brainchild of Ōtepoti/ Dunedin musician Shlee Nicholls (Mary Berry, Flesh Bug). We play noise music.\",\"Please provide links to your social channels\":\"https://www.facebook.com/Dalekerriganfour/?ref=page_internal\\nhttps://www.instagram.com/dalekerrigan_band/\",\"Links\":\"https://dalekerrigan.bandcamp.com/\",\"Name\":\"Dale Kerrigan\",\"Portrait Press Shot\":[{\"id\":\"attcONSloYTT32cq0\",\"width\":1080,\"height\":1080,\"url\":\"https://dl.airtable.com/.attachments/3bda1dcbeb6b760d2