,\"url\":\"https://dl.airtable.com/.attachments/46da58ebd901676a7c8637f54ea41f62/5008f3cf/dawn-diver.jpg?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=e75d309de2d51f50\",\"filename\":\"dawn-diver.jpg\",\"size\":354912,\"type\":\"image/jpeg\",\"thumbnails\":{\"small\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/0ceb588d07aa340caf91ec2564a27362/9be40f50?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=893ab0e71cd8d385\",\"width\":36,\"height\":36},\"large\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/25c5939dc004de80f70c1482d05c8474/774438d2?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=adb3d0f1adeeb02e\",\"width\":512,\"height\":512},\"full\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/82f1bd61ef2893b41229f6b084dd20f1/5663bf88?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=8b311f7b1ac0b207\",\"width\":3000,\"height\":3000}}}],\"Genre\":\"Progressive Indie\"}},{\"id\":\"recXOOSazM6EIAt7J\",\"created_at\":\"2021-10-27T21:14:11.000Z\",\"updated_keys\":[],\"fields\":{\"Bio (Extended)\":\"DOONS are a high energy indie-froth-rock band based and well established their hometown of Pōneke/Wellington. With powerful vocals, elegant lead guitar and a potent rhythm section, sincerity reigns supreme through DOONS’ live set. Following the release of their EP ‘The Importance of Being Indifferent’, DOONS are looking forward new music and bigger shows. Having shared the stage with acts such as RIIKI, Ha the Unclear, DARTZ and Hot Donnas, they are ready to grace the festival circuit this summer.\",\"Hometown\":\"Pōneke / Wellington\",\"Bio\":\"Replete with intently honed songwriting (Elliott Dawson), shimmery lead guitar (Benji’s Palace) and a potent rhythm section, sincerity reigns supreme through their considered and growing catalogue which is certified to make you move and feel.\",\"Please provide links to your social channels\":\"https://www.instagram.com/doonsys/?hl=en \\nhttps://www.facebook.com/doonsys/ \\nhttps: