nt back home, she's been able to begin her career here as a solo artist in NZ, and will be making her debut with her full band in the summer of 2022. \",\"Hometown\":\"Pōneke / Wellington via Philadelphia \",\"Links\":\"https://rachelandie.bandcamp.com/\\nhttps://soundcloud.app.goo.gl/H7bf2hDR8XG5YEyR8\\nhttps://open.spotify.com/artist/3QNc8XAo1becG4cs9rIOjG?si=gpf0VCQhRXeEgpmo-I3V6A \\n\",\"Name\":\"Rachel Andie\",\"Portrait Press Shot\":[{\"id\":\"att9FetmkwbOCc7mF\",\"width\":1080,\"height\":1080,\"url\":\"https://dl.airtable.com/.attachments/67d14b0d2c2c1b1966bf1fba9db75bb5/54abb1d9/rachel-andie.jpg?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=4647e57213b7cf0b\",\"filename\":\"rachel-andie.jpg\",\"size\":269891,\"type\":\"image/jpeg\",\"thumbnails\":{\"small\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/51efa9019168f2472669edfcd58f443a/6c9c8a92?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=078cdd402385fd68\",\"width\":36,\"height\":36},\"large\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/71a5b80e8fbcac047e74d43446818313/0befddfe?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=06f50d9d86f9f0df\",\"width\":512,\"height\":512},\"full\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/4e4d8b50cbb7e4ce9137bb76f70f702e/acc7af50?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=845814729ee92ca4\",\"width\":3000,\"height\":3000}}}],\"Genre\":\"Ethereal rock\"}},{\"id\":\"reccYKUi1YI83s8ie\",\"created_at\":\"2021-10-27T21:14:04.000Z\",\"updated_keys\":[],\"fields\":{\"Bio (Extended)\":\"Baby Kiko is a multi-disciplinary artist born and based in Pōneke. Her creative practice fuses spatial design, music, and dance. Her distinguished approach uses her creative practice and carves out intentional and inclusive spaces in Aotearoa. \\n\\nHer unique sound blends genres ranging from R\\u0026B and Funk/Soul to Breaks and Dance music. Kiko’s sets are crafted to time and place, vibes and vibrations, and to inspire bodies to move, dance and express with no inhibitions. Shake ya a$$!!!\",\"Hometown\":\"Pōneke / Wellington \",\"Bio\":\"Pōneke based DJ and artist, Baby Kiko, shares her spice through her unique selection that is crafted to time and place, vibes and vibrations, and to inspire bodies to move, dance, and express with no inhibitions. \",\"Links\":\"https://soundcloud.com/bbkikoe\\n\",\"Name\":\"Baby Kiko\",\"Portrait Press Shot\":[{\"id\":\"attTozCovQaMZKY6Y\",\"width\":1080,\"height\":1080,\"url\":\"https://dl.airtable.com/.attachments/ab1aa5ae2fb9728add2cde6e7f03dfb0/31b6256f/emmakiko.jpg?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=0777640efd3453c5\",\"filename\":\"emmakiko.jpg\",\"size\":327649,\"type\":\"image/jpeg\",\"thumbnails\":{\"small\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/0975059b1340e64ca4896b9bedb2608b/df5d0166?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=a8750c747b13ee03\",\"width\":36,\"height\":36},\"large\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/331a47a394ecd2af469c988bd216edf2/1a6330a2?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=bcc892a815c1dec5\",\"width\":512,\"height\":512},\"full\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/414f71e03bd3857fb7cfc2c0928c21de/42a65934?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=e7aa186938bd83c3\",\"width\":3000,\"height\":3000}}}],\"Genre\":\"Electronic\"}},{\"id\":\"recg6wEI5La0ndrF2\",\"created_at\":\"2021-09-06T03:56:00.000Z\",\"updated_keys\":[],\"fields\":{\"Bio (Extended)\":\"alice agnes is leading the new wave of Pōneke club talent. Under the tutelage of legends like DJ Raw and Alphabethead, Alice developed a style that melds the vast possibilities of electronic music with the playful yet focused demeanour of a turntable wizard. Outside of the booth, Alice is 1/3 of Practice, a collective and event series that showcases underground sounds and celebrates local artists.\",\"Hometown\":\"Pōneke / Wellington\",\"Bio\":\"alice agn