-a-Tara, Marielle hosts a bi-weekly radio show on Mouthfull Radio, 1 hour of musical exploration under the name Archive Quality.\\n\\nDriven by the dig, Marielle looks to expose listeners to old and new sounds that skew towards the leftfield. Comfortable in a messy intersection of electro, breaks, bass, and house, she aims her live sets to go hard but have fun.\\n\\nOff the back of 2 high energy sets in Wellington and Christchurch in 2021 with WAY.PNT and Strange Behaviour, she is stoked to bring some filthy, fun \\u0026 ravey vibes to Welcome to Nowhere. \",\"Hometown\":\"Pōneke / Wellington \",\"Bio\":\"Hailing from Te Whanganui-a-Tara, Marielle hosts a bi-weekly radio show on Mouthfull Radio, 1 hour of musical exploration under the name Archive Quality. Comfortable in a messy intersection of electro, breaks, bass, and house, she aims her live sets to go hard but have fun.\",\"Links\":\"https://www.mixcloud.com/MouthfullRadio/playlists/archive-quality/\",\"Name\":\"Marielle\",\"Portrait Press Shot\":[{\"id\":\"attA0CjmqJKZOwf9W\",\"width\":1080,\"height\":1080,\"url\":\"https://dl.airtable.com/.attachments/0f9e20a4e36db96b271b41422ebff5a2/754df453/marielle.jpg?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=d2cba7253531afd2\",\"filename\":\"marielle.jpg\",\"size\":300818,\"type\":\"image/jpeg\",\"thumbnails\":{\"small\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/5fc9ad96ee36b6bf17e584ff893b04a1/48bf2faf?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=2321d8f4fd9447f8\",\"width\":36,\"height\":36},\"large\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/95ef5eff7cf97a087cad795615903500/e366820f?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=2bac1957bb782326\",\"width\":512,\"height\":512},\"full\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/1f58d88da1410df9294e34f3944c377c/1ce003e0?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=6dd5309ecd8281da\",\"width\":3000,\"height\":3000}}}],\"Genre\":\"Electro/Breaks/Bass\"}},{\"id\":\"recjpTjkIfId3eOUz\",\"created_at\":\"2021-10-04T03:24:44.000Z\",\"updated_keys\":[],\"fields\":{\"Bio (Extended)\":\"Anthonie Tonnon is a songwriter and performer originally from Ōtepoti, now based in Whanganui. \\n\\nTo release his third full-length album, Leave Love Out Of This, Tonnon is returning a full band to the stage for the first time since 2018, including Stuart Harwood (hybrid electric/acoustic drums), David Flyger (bass, bass synthesizer), Brooke Singer (synthesisers) Sam Taylor (guitar and percussion). \\n\\n\\\"Anthonie Tonnon's is a story of innovation and reinvention in a changing music industry, and of memorable songs about things most people don’t write songs about.\\\" Audioculture\",\"Hometown\":\"Whanganui\",\"Bio\":\"Anthonie Tonnon is a songwriter and performer originally from Ōtepoti, now based in Whanganui, with a five piece band including members from Tāmaki Makaurau and Te Whanganui-a-Tara. \",\"Links\":\"https://www.anthonietonnon.com/\",\"Name\":\"Anthonie Tonnon\",\"Portrait Press Shot\":[{\"id\":\"attIdMF5igAmPgh5b\",\"width\":1080,\"height\":1080,\"url\":\"https://dl.airtable.com/.attachments/95f52edb962565b8d6a50cfd7110a11a/b81d16df/anthonie-tonnon.jpg?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=7c15f1ca39a48605\",\"filename\":\"anthonie-tonnon.jpg\",\"size\":440469,\"type\":\"image/jpeg\",\"thumbnails\":{\"small\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/7cb9959b3902541117c2e38d6d96ebf1/8111d7d4?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=f2c0b2f2b3045100\",\"width\":36,\"height\":36},\"large\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/c50eee5c811ce18bfb5fd71ec2195da8/0e5a0a53?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=6735472287094994\",\"width\":512,\"height\":512},\"full\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/eb99e777e6de4bd6e26230c6d9724ce0/a1e93d7c?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=360b7b91e8b9efac\",\"width\":3000,\"height\":3000}}}],\"Genre\":\"Art Pop\",\"Application Type\":\"Music\"}},{\"id\":\"recoWHfKwutxrtwy9\",\"created_at\":\"2021-08-04T04:56:07.000Z\",\"updated_keys\":[],\"fields\":{\"Bio (Extended)\":\"Merk is the solo project of songwriter, producer and multi-instrumentalist Mark Perkins, which began when Perkins recorded 2016’s Swordfish (winner of Best Debut at the Taite Music Prize). His debut album showcased a knack for melody, based around guitars strummed to catchy perfection. While Swordfish introduced many of the qualities that Merk continues to cultivate, it’s on Infinite Youth that he comes fully into his own. “In the past it felt like I was hiding, but now I’m trying to wear my heart on my sleeve a little more,” Perkins muses. He has an understated, commanding presence, a playful intensity, as well as an ability to simply let go. Lyrically, this album treads a line between earnest, vulnerable, and knowingly tongue in cheek: songs that began in irony mutated into sincerity, and vice versa. \",\"Hometown\":\"Tāmaki Makaurau / Auckland\",\"Bio\":\"Merk is the solo project of songwriter, producer and multi-instrumentalist Mark Perkins.\",\"Please provide links to your social channels\":\"https://www.facebook.com/merkscoolsongs\\nhttps://www.instagram.com/merkperk/\\nhttps://twitter.com/merkscoolsongs?lang=en\\n\",\"Links\":\"https://merkscoolsongs.bandcamp.com/album/infinite-youth\",\"Name\":\"merk\",\"Portrait Press Shot\":[{\"id\":\"att4vs2PWA4whWZof\",\"width\":1080,\"height\":1080,\"url\":\"https://dl.airtable.com/.attachments/7a48b9962d356159f3d4970d8c4fefd1/3408fb31/merk.jpg?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=8950a811d77b8aa9\",\"filename\":\"merk.jpg\",\"size\":306622,\"type\":\"image/jpeg\",\"thumbnails\":{\"small\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/b9fc6e221e352c708943b50134739348/d53ce796?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=75ebcd651d995c93\",\"width\":36,\"height\":36},\"large\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/cc7108c6cf81a803930397bfd0358d01/b9ac0be9?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=c64b40587240b6a2\",\"width\":512,\"height\":512},\"full\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/eb442efc0fe3219abcb08b89df6258c1/ec11f282?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=2cbe6cafcff01ffe\",\"width\":3000,\"height\":3000}}}],\"Genre\":\"Indie Pop\",\"Application Type\":\"Music\"}},{\"id\":\"recpR7ufLXhzO5bbg\",\"created_at\":\"2021-08-04T04:56:07.000Z\",\"updated_keys\":[],\"fields\":{\"Bio (Extended)\":\"Jazmine Mary is a Dream Folk Artist from Gippsland Australia. Visceral and haunting, their surreal rose-tinted sounds will allow you to be transported somewhere bold and watery.\\n\\nTheir debut album The Licking of a Tangerine was recorded late last year at Auckland's Roundhead Studios and released early in 2021 with two back-to-back sold out shows at Auckland’s Wine Cellar.\",\"Hometown\":\"Tāmaki Makaurau / Auckland\",\"Bio\":\"Empty snails from shells to get closer to the sea. \\nSand in teeth. \\nYou're never alone when you have music. \",\"Please provide links to your social channels\":\"https://www.facebook.com/Jazminemarymusic\\n@jazmine__mary \",\"Links\":\"https://open.spotify.com/album/1hQocspIDd3AMd09VBhL6y?si=OgUP7MAGR-CfqHVICJJQVg\",\"Name\":\"Jazmine Mary\",\"Portrait Press Shot\":[{\"id\":\"atttcd2sugILBqUMq\",\"width\":1080,\"height\":1080,\"url\":\"https://dl.airtable.com/.attachments/46eda080092305221c11f57689c7d797/6a5b691f/jazmine-mary.jpg?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=352889f667823232\",\"filename\":\"jazmine-mary.jpg\",\"size\":349914,\"type\":\"image/jpeg\",\"thumbnails\":{\"small\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/19f3c58b92d6629746a1950c20d56b1d/bb4d59d5?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=830e641f19e3e8b2\",\"width\":36,\"height\":36},\"large\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/3259c3d3a0b5a89f0bd33acb583986ff/ca9adf7d?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=99c785618d29b9bd\",\"width\":512,\"height\":512},\"full\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/e299d98022f2761a86146e221cdadff1/186e2593?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=4707d575e6c97390\",\"width\":3000,\"height\":3000}}}],\"Genre\":\"Nior Folk\",\"Application Type\":\"Music\"}},{\"id\":\"recqVch76OINpFYsy\",\"created_at\":\"2021-10-27T21:14:05.000Z\",\"updated_keys\":[],\"fields\":{\"Bio (Extended)\":\"Woods has remained consistently performing and producing work since his debut in 2018. If not circuiting New Zealand with his group, touring or performing at festivals, he could be found composing soundtracks for film. The release of his ruminative long player PUT saw him performing alongside Steve Gunn, No Age, Tiny Ruins, and touring with Aldous Harding. Through lockdown, Woods turned his energy outwards as he managed an online streaming festival –Better Living, Everyone. The festival boasted 30+ artists including Lawrence Arabia, Marlon Williams, Emily Edrosa, and Delaney Davidson, and attained more than 15,000 viewers.\\n\",\"Hometown\":\"Ōtautahi / Christchurch\",\"Bio\":\"Blending ruminative verse and modulating guitar jank, Woods and his group of all stars bring to life his newfangled brand of poignancy.\",\"Please provide links to your social channels\":\"Instagram - https://www.instagram.com/benjameswoods/\\n\",\"Links\":\"https://babyben.bandcamp.com/\",\"Name\":\"Ben Woods\",\"Portrait Press Shot\":[{\"id\":\"att4Ns6QtKvrQYGIQ\",\"width\":1080,\"height\":1080,\"url\":\"https://dl.airtable.com/.attachments/95248be5814bdbe52dda0b298eff63df/d7cbbaa5/ben-woods.jpg?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=78f63ab6006cf0f9\",\"filename\":\"ben-woods.jpg\",\"size\":391637,\"type\":\"image/jpeg\",\"thumbnails\":{\"small\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/6c742c8747f47a58e5a98e147e0a1be8/cbff1a8f?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=26b88208b160079a\",\"width\":36,\"height\":36},\"large\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/36b81adfee342d2b0b1e34653987c701/c6d22913?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=6c8055f583a8096f\",\"width\":512,\"height\":512},\"full\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/8736e2016e7a60640b1da896b64b968c/ec005f63?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=ed7393ffcfe55ab6\",\"width\":3000,\"height\":3000}}}],\"Genre\":\"Alternative/Indie\",\"Application Type\":\"Music\"}},{\"id\":\"rectKG4T0spxAKHtN\",\"created_at\":\"2021-10-27T21:14:14.000Z\",\"updated_keys\":[],\"fields\":{\"Bio (Extended)\":\"Lizard Prom are a four piece alternative rock band from Te Matau-a-Maui/Hawkes Bay. They draw influence from a variety of genres including shoegaze, post-punk and doom. Previously named Queens of Beauty School, the band started mid-2014. During this period the band opened for Jakob and The Veils, as well as playing various local shows. After a hiatus in 2018, the band regrouped at the start of 2019, renaming as Lizard Prom. During 2019 they recorded and released their self titled debut EP, featuring the single Betty Goes to Hell. This track peaked at number 1 on Radio One.\\nContinuing to play live regularly in their hometown of Hawkes Bay, Lizard Prom have built up a reputation as an exciting live act with chaotic energy, most recently opening for Beastwars on the Napier stop of their late 2019 tour. They are due to release their new EP, Unusual Pain in July 2021 and to embark on a small tour to support the release.\",\"Hometown\":\"Te Matau-a-Māui / Hawkes Bay\",\"Bio\":\"Lizard Prom are four quiet people from Te Matau-a-Maui that get together and make loud sounds.\",\"Please provide links to your social channels\":\"https://www.facebook.com/lizardprom/\\nhttps://www.instagram.com/lizard_prom/?hl=en\\nhttps://www.youtube.com/channel/