,\"width\":1080,\"height\":1080,\"url\":\"https://dl.airtable.com/.attachments/2b43e8f19f7b44aa258ce6896ea0bd79/ff75d57c/deepstate.jpg?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=91d83be264be7e30\",\"filename\":\"deepstate.jpg\",\"size\":308685,\"type\":\"image/jpeg\",\"thumbnails\":{\"small\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/795407c1ebc399ff4243431a88b9f392/253e268b?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=79ffd340fe890c8e\",\"width\":36,\"height\":36},\"large\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/cf4a7cd6eb045df0520a45a24bf07f26/eefd43a4?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=d2df981c60959731\",\"width\":512,\"height\":512},\"full\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/9d3eedf9c8967d2cbc500137d7a94e38/80134adb?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=8fb4106b3483d7b6\",\"width\":3000,\"height\":3000}}}],\"Genre\":\"Electronic\",\"Application Type\":\"Music\"}},{\"id\":\"recxE1KGGK6NiwAM8\",\"created_at\":\"2021-08-04T04:56:07.000Z\",\"updated_keys\":[],\"fields\":{\"Bio (Extended)\":\"Juno Is is the project of Dunedin based musician Mackenzie Hollebon. Born as a home recording experiment, Juno Is has developed a distinctive sound of lovely rhythmic guitars, disruptive lead tones and lush layered vocals. Her sound can easily be defined as ‘Psychedelic Dream Rock’. After releasing her 2020 debut EP ‘Creature Of Habit’ Mackenzie has decided to sparkle up her sound with her recent singles ‘Floating’ and ‘So Hazy’ which are a part of her debut album that will come out late 2021. After playing many exciting live shows as a 5 piece band through 2020, Juno Is decided to complete a successful summer tour through New Zealand. Keep your eyes open for new music and more shows throughout this year!\\n\\n\\n\",\"Hometown\":\"Ōtepoti / Dunedin\",\"Bio\":\"Psychedelic Dream Rock band Juno Is is the solo project of Dunedin based musician Mackenzie Hollebon discovering the depths of her mind through music.\",\"Please provide links to your social channels\":\"https://www.facebook.com/junoissnazzy\\nInstagram: https://www.instagram.com/welcometonowhere_/ \",\"Links\":\"https://open.spotify.com/track/1n72ZiqTcf1MlaZaoqsI4X?si=da34ebdd301242b8 \",\"Name\":\"Juno Is\",\"Portrait Press Shot\":[{\"id\":\"attkqJ6fY7Ly2wjv6\",\"width\":1080,\"height\":1080,\"url\":\"https://dl.airtable.com/.attachments/dc98812b021387c19857c10e3da82c9c/3c41568f/juno-is.jpg?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=06e9e127ab8dc4b1\",\"filename\":\"juno-is.jpg\",\"size\":644062,\"type\":\"image/jpeg\",\"thumbnails\":{\"small\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/e29363f6d34d70964e90efdb333af4ba/b4c51b62?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=617041e60d7571fc\",\"width\":36,\"height\":36},\"large\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/5707c79e5ca7b25a4df6cda4b2385bc5/8e8bccd4?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=e4799d0db06f6121\",\"width\":512,\"height\":512},\"full\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/e19b8ad7a3b97922c7a9823c1399650e/fca5428d?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=df928d911202b671\",\"width\":3000,\"height\":3000}}}],\"Genre\":\"Psychedelic Indie Rock\",\"Application Type\":\"Music\"}},{\"id\":\"recy1ItrHbFJ6lAoO\",\"created_at\":\"2021-08-04T04:56:07.000Z\",\"updated_keys\":[],\"fields\":{\"Bio (Extended)\":\"Waterfalls is the electronic avant-dream pop project of multi-instrumentalist Amber Johnson ( Flute, Vocals, Synthesizers, Production). Amber has been playing and touring for a good few years and after a hiatus is back in action and currently performing new material from her forthcoming EP 'Single' ( mixed with Danny Brady of Death and the Maiden)  with some old treats in the mix. Waterfalls trusts in an intuitive approach to composition and creates beautiful melodies and lush immersive timbres from hypnotic loops, synthesizer explorations and processed flute and vocals. Her euphoric and mesmerising performances wind their way through movements creating impressionistic atmospheres, crystallising emotional states and delivering knock out vocals.\",\"Hometown\":\"Pōneke / Wellington\",\"Bio\":\"Waterfalls creates captivating music full of beautiful melodies and lush timbres. Synthesizer explorations, processed flute and stunning vocals meld together to form Amber Johnson's singular sound. \",\"Please provide links to your social channels\":\"https://www.facebook.com/Waterfallspage\\nhttps://www.instagram.com/waterfalls_._._/ \",\"Links\":\"https://waterfalls4.bandcamp.com/\",\"Name\":\"Waterfalls\",\"Portrait Press Shot\":[{\"id\":\"attD5z9aBs6iC64VU\",\"width\":1080,\"height\":1080,\"url\":\"https://dl.airtable.com/.attachments/1e39fe2fec5ede0105e1b4bdc6da551e/3a6034e6/waterfalls.jpg?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=381a2ad22ef03e0e\",\"filename\":\"waterfalls.jpg\",\"size\":533837,\"type\":\"image/jpeg\",\"thumbnails\":{\"small\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/252e00f8a72288bd4feb9e3e9d8dd92a/85dff3ce?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=2f4b65d8659478d9\",\"width\":36,\"height\":36},\"large\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/4f17d7c7ca58e58e15aa6a6a1fd5d952/2a577c79?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=52c85c687458c4f1\",\"width\":512,\"height\":512},\"full\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/be519d19371f548cef4e4b57bac89209/5c658194?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=55789ffd9008f47c\",\"width\":3000,\"height\":3000}}}],\"Genre\":\"Avant-pop\",\"Application Type\":\"Music\"}},{\"id\":\"recyGNwfClx6BVXZq\",\"created_at\":\"2021-09-12T20:09:55.000Z\",\"updated_keys\":[],\"fields\":{\"Bio (Extended)\":\"Prove It are two tamaki makaurau based producers and djs. With a focus on percussive grooves, breaks, shuffle and bass - a Prove It set is likely to span multiple genres and sounds with an eclectic mix of both electronic and band music.\",\"Hometown\":\"Tāmaki Makaurau / Auckland\",\"Bio\":\"Introducing Prove It! Expect percussive grooves, breaks, shuffle and UK bass with a healthy dose of band music thrown in to keep the punters singing along. \\n\\n(Formerly known as Sacktap).\",\"Please provide links to your social channels\":\"https://soundcloud.com/user-414970328\",\"Links\":\"https://soundcloud.com/user-414970328\\n\",\"Name\":\"Prove It\",\"Portrait Press Shot\":[{\"id\":\"attsH4dzQwr3hlNjH\",\"width\":1080,\"height\":1080,\"url\":\"https://dl.airtable.com/.attachments/47dc80f39b35fa7995189ef376466129/3ffbdda5/prove-it.jpg?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=63178d7aa6a3c69c\",\"filename\":\"prove-it.jpg\",\"size\":245220,\"type\":\"image/jpeg\",\"thumbnails\":{\"small\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/b1e7b42e3571b4a333043c2b4c68fccf/1e822186?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=026de9f674eae51c\",\"width\":36,\"height\":36},\"large\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/1400a45e5b99319e39915559d8df2611/a8e9fb88?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=b7aa34d3f726235d\",\"width\":512,\"height\":512},\"full\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/2306fbb39712c9935426140c79cbd120/8506cf33?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=e9ede6575d74722e\",\"width\":3000,\"height\":3000}}}],\"Genre\":\"Techno/House/Bass\",\"Application Type\":\"Music\"}},{\"id\":\"recyzIT393fsPDHTa\",\"created_at\":\"2021-08-04T04:56:07.000Z\",\"updated_keys\":[],\"fields\":{\"Bio (Extended)\":\"Paloma Schneideman does it all, she started her journey at film school in Auckland where she would go on to be featured in the New Zealand International Film Festival. Although she’s been nominated for many awards in film, music was always in the rear view of Schneideman.\\n\\nInitially PollyHill started as a duo with producer Ollie when they both met while working at AS Colour. Since then Paloma has taken PollyHill solo, emerging as one of the hottest local acts in Auckland in 2019. Making the rounds of the underground venues, PollyHill was gaining a loyal fan base and soon was catching the eye of the rest of New Zealand. Inspired by the likes of MF DOOM, PollyHill and her retail colleagues would be making weird and wacky beats while Polly pulled out the bars. 2020 saw PollyHill re-release her debut EP ‘Greatest Hits’ and two new singles ‘Spooky’ and ‘Mentor’, which both found huge success on student radio across the country. \\n\\nHer charismatic stage presence along with infectious flow clearly took note of her peers, as she’s opened for the likes of Wiki, Church \\u0026 AP, Imugi and Wax Mustang. This past summer saw PollyHill make her festival debut with Rhythm \\u0026 Vines, Splore, Soundsplash and many more on her summer schedule. Storming into 2021, PollyHill released her most successful single to date ’Sweepstake’ with Church Leon (Church \\u0026 AP). \",\"Hometown\":\"Tāmaki Makaurau / Auckland\",\"Bio\":\"Auckland based MC PollyHill has garnered a loyal underground following with her gritty hyper lyricism and experimental production. \",\"Please provide links to your social channels\":\"https://www.instagram.com/pollyhillxoxo/\\n\",\"Links\":\"https://open.spotify.com/artist/66oPXcN1mDhQLwveHEaJWX?si=Yjo2Z0GLTi6vqGlhnWa3sA\",\"Name\":\"PollyHill x Olli Jones\",\"Portrait Press Shot\":[{\"id\":\"att82zqyc4byHTS1m\",\"width\":1080,\"height\":1080,\"url\":\"https://dl.airtable.com/.attachments/ae20ff55076cf5c7b78b96492fb38336/055f7790/pollyhill.jpg?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=157ccd83ae0f1f26\",\"filename\":\"pollyhill.jpg\",\"size\":558343,\"type\":\"image/jpeg\",\"thumbnails\":{\"small\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/a74933d5208d7fbecfbfb9220773f636/7a0edceb?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=bd43df4af60cb671\",\"width\":36,\"height\":36},\"large\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/7d2eea2bf0c9dcca7724844b4495fdce/6ada268a?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=98c1892e00658e16\",\"width\":512,\"height\":512},\"full\":{\"url\":\"https://dl.airtable.com/.attachmentThumbnails/29d629dca58a2e3051e7b5cded99e41e/954be6a2?ts=1660899060\\u0026userId=usrviWUY01ylhOZHT\\u0026cs=9cc93b2667b9c291\",\"width\":3000,\"height\":3000}}}],\"Genre\":\"Rap\",\"Application Type\":\"Music\"}}]",
